import React from "react";
import Draggable from "react-draggable";
import { Card } from 'react-bootstrap';
import { useDraggble } from "../../contexts/DraggableContext";
export const Vector = () => {
  const {position,handleStop}=useDraggble()
    return (
        <Draggable position={position} onStop={handleStop}>
           <Card className="mb-2">
        <Card.Body className="text-center">Vector</Card.Body>
      </Card>
        </Draggable>
    )
}
